import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

const AdminMain = () => {
    return (
        <Container>
            <Row>
                <Col>
                    <Button variant="primary" className='mt-3'>Просмотреть заявки</Button>
                </Col>
                <Col>
                    <Button variant="primary" className='mt-3'>Просмотреть статистику</Button>
                </Col>
            </Row>
        </Container>
    );
};

export default AdminMain;
